import styled from "styled-components";

export const Hire = styled.div`
    width: 100%;
    background-color: #787D89;
    padding: 50px 40px;
    border-radius: 10px;
    color: white;
    display: flex;
    justify-content: space-between;

    button{
        border: none;
        background: var(--btn-color);
    }

    @media (max-width: 480px) {
        padding: 25px 20px;
    }
`;
